import React, { Component } from "react";
import { Container, Typography } from "@material-ui/core";
import Grid from "@material-ui/core/Grid";
import opc2 from "../../assets/img/opc2.jpeg";

const styles = {
  container: {
    margin: "50px",
  },
  image:{}
};

export default class ProductPage extends Component {
  render() {
    return (
      <div id="productPage" style={styles.container}>
        <Container>
          <Grid
            container
            direction="row"
            // justify="center"
            alignItems="center"
            spacing={5}
          >
            <div id="productImage">
              <Grid item md={8} lg={3}>
                <img src={opc2} alt="productImage" style={{ height: 350 }} />
              </Grid>
            </div>
            <div id="product">
              <Grid item md={3} lg={3}>
                <h2>Product</h2>
              </Grid>
            </div>
          </Grid>
        </Container>
      </div>
    );
  }
}
